The '''Lethe Gorge''' is a dungeon branch exclusive to the [[Lethe patch]], located between the [[Dungeons of Doom]] and [[Gehennom]]. The Gorge is composed of nine floors in total, and replaces the normal floors between [[Medusa's Island]] and the [[Valley of the Dead]].

==River head==
There are two different versions of the river head. Both have undiggable floors and contain [[amnesia]]-inducing Lethe water. The river head is on a separate branch: it is accessible by a separate upstair, and the level is a dead-end. 

